import{_ as a,c as e,o as t,ag as l}from"./chunks/framework.CQuhCYrb.js";const g=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"content/1.introduction/4.troubleshooting.md","filePath":"content/1.introduction/4.troubleshooting.md","lastUpdated":1764254219000}'),o={name:"content/1.introduction/4.troubleshooting.md"};function s(n,i,r,h,d,p){return t(),e("div",null,[...i[0]||(i[0]=[l(`<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h1><p>本节列举了使用 AgentKit SDK 时的常见问题和解决方案。</p><h2 id="安装问题" tabindex="-1">安装问题 <a class="header-anchor" href="#安装问题" aria-label="Permalink to &quot;安装问题&quot;">​</a></h2><h3 id="问题-pip-安装失败" tabindex="-1">问题：pip 安装失败 <a class="header-anchor" href="#问题-pip-安装失败" aria-label="Permalink to &quot;问题：pip 安装失败&quot;">​</a></h3><p><strong>现象</strong>：执行 <code>pip install</code> 时报错连接超时或包找不到。</p><p><strong>解决方案</strong>：</p><ol><li>确认网络连接正常</li><li>使用内部源安装：<div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">pip</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --pre</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -U</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> agentkit-sdk-python</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --index-url</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> https://artifacts-cn-beijing.volces.com/repository/agentkit/simple/</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --extra-index-url</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> https://mirrors.tuna.tsinghua.edu.cn/pypi/web/simple</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --trusted-host</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> mirrors.tuna.tsinghua.edu.cn</span></span></code></pre></div></li><li>检查 Python 版本是否为 3.12+</li></ol><h3 id="问题-cli-命令不可用" tabindex="-1">问题：CLI 命令不可用 <a class="header-anchor" href="#问题-cli-命令不可用" aria-label="Permalink to &quot;问题：CLI 命令不可用&quot;">​</a></h3><p><strong>现象</strong>：执行 <code>agentkit</code> 命令时提示 <code>command not found</code>。</p><p><strong>解决方案</strong>：</p><ol><li>确认安装成功：<code>pip list | grep agentkit</code></li><li>检查 PATH 环境变量是否包含 pip 的 bin 目录</li><li>尝试重新安装：<code>pip install -U agentkit-sdk-python-inhouse-nightly</code></li></ol><h2 id="配置问题" tabindex="-1">配置问题 <a class="header-anchor" href="#配置问题" aria-label="Permalink to &quot;配置问题&quot;">​</a></h2><h3 id="问题-环境变量未生效" tabindex="-1">问题：环境变量未生效 <a class="header-anchor" href="#问题-环境变量未生效" aria-label="Permalink to &quot;问题：环境变量未生效&quot;">​</a></h3><p><strong>现象</strong>：提示无法连接到 AgentKit Platform 或认证失败。</p><p><strong>解决方案</strong>：</p><ol><li>确认已设置必需的环境变量：<div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">echo</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> $VOLCENGINE_ACCESS_KEY</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">echo</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> $VOLCENGINE_SECRET_KEY</span></span></code></pre></div></li><li>确保没有多余的空格或引号</li><li>在当前 shell 会话中重新 export 环境变量</li></ol><h3 id="问题-配置文件格式错误" tabindex="-1">问题：配置文件格式错误 <a class="header-anchor" href="#问题-配置文件格式错误" aria-label="Permalink to &quot;问题：配置文件格式错误&quot;">​</a></h3><p><strong>现象</strong>：执行 <code>agentkit launch</code> 时提示配置文件解析失败。</p><p><strong>解决方案</strong>：</p><ol><li>检查 <code>agentkit.yaml</code> 格式是否正确（注意缩进）</li><li>重新运行 <code>agentkit config</code> 生成配置</li><li>参考快速开始文档中的配置示例</li></ol><h2 id="部署问题" tabindex="-1">部署问题 <a class="header-anchor" href="#部署问题" aria-label="Permalink to &quot;部署问题&quot;">​</a></h2><h3 id="问题-cr-创建失败" tabindex="-1">问题：CR 创建失败 <a class="header-anchor" href="#问题-cr-创建失败" aria-label="Permalink to &quot;问题：CR 创建失败&quot;">​</a></h3><p><strong>现象</strong>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CreateRegistry: QuotaExceeded.Registry The quota of Registry is exceeded.</span></span></code></pre></div><p><strong>解决方案</strong>：</p><ol><li>CR 实例数量超出配额限制</li><li>在 <code>agentkit config</code> 中配置为已有的 CR 实例名称</li><li>或联系管理员提高配额</li></ol><h3 id="问题-镜像构建失败" tabindex="-1">问题：镜像构建失败 <a class="header-anchor" href="#问题-镜像构建失败" aria-label="Permalink to &quot;问题：镜像构建失败&quot;">​</a></h3><p><strong>现象</strong>：Pipeline 构建失败，提示依赖安装错误。</p><p><strong>解决方案</strong>：</p><ol><li>检查 <code>requirements.txt</code> 中的依赖是否正确</li><li>确认依赖版本是否兼容 Python 3.12</li><li>查看 Pipeline 日志获取详细错误信息</li></ol><h3 id="问题-runtime-部署超时" tabindex="-1">问题：Runtime 部署超时 <a class="header-anchor" href="#问题-runtime-部署超时" aria-label="Permalink to &quot;问题：Runtime 部署超时&quot;">​</a></h3><p><strong>现象</strong>：Runtime 长时间处于 <code>Releasing</code> 状态。</p><p><strong>解决方案</strong>：</p><ol><li>首次部署通常需要 2-3 分钟，请耐心等待</li><li>使用 <code>agentkit status</code> 检查状态</li><li>如果超过 5 分钟仍未就绪，可能是资源不足，尝试 <code>agentkit destroy</code> 后重新部署</li></ol><h3 id="问题-runtime-状态异常" tabindex="-1">问题：Runtime 状态异常 <a class="header-anchor" href="#问题-runtime-状态异常" aria-label="Permalink to &quot;问题：Runtime 状态异常&quot;">​</a></h3><p><strong>现象</strong>：Runtime 状态为 <code>Failed</code> 或 <code>Error</code>。</p><p><strong>解决方案</strong>：</p><ol><li>检查环境变量配置是否正确（特别是模型 API Key）</li><li>查看 AgentKit Platform 控制台的日志</li><li>确认应用代码没有启动时错误</li><li>尝试使用 <code>agentkit destroy</code> 清理后重新部署</li></ol><h2 id="调用问题" tabindex="-1">调用问题 <a class="header-anchor" href="#调用问题" aria-label="Permalink to &quot;调用问题&quot;">​</a></h2><h3 id="问题-invoke-调用失败" tabindex="-1">问题：invoke 调用失败 <a class="header-anchor" href="#问题-invoke-调用失败" aria-label="Permalink to &quot;问题：invoke 调用失败&quot;">​</a></h3><p><strong>现象</strong>：执行 <code>agentkit invoke</code> 时提示连接失败或超时。</p><p><strong>解决方案</strong>：</p><ol><li>使用 <code>agentkit status</code> 确认 Runtime 状态为 <code>Ready</code></li><li>检查网络连接</li><li>确认 Endpoint 地址正确</li><li>检查防火墙或代理设置</li></ol><h3 id="问题-模型调用失败" tabindex="-1">问题：模型调用失败 <a class="header-anchor" href="#问题-模型调用失败" aria-label="Permalink to &quot;问题：模型调用失败&quot;">​</a></h3><p><strong>现象</strong>：Agent 返回错误，提示模型访问失败。</p><p><strong>解决方案</strong>：</p><ol><li>确认方舟模型 API Key 配置正确</li><li>检查接入点 ID 是否有效</li><li>确认模型配额是否用尽</li><li>登录方舟平台检查 API Key 权限</li></ol><h2 id="权限问题" tabindex="-1">权限问题 <a class="header-anchor" href="#权限问题" aria-label="Permalink to &quot;权限问题&quot;">​</a></h2><h3 id="问题-ak-sk-认证失败" tabindex="-1">问题：AK/SK 认证失败 <a class="header-anchor" href="#问题-ak-sk-认证失败" aria-label="Permalink to &quot;问题：AK/SK 认证失败&quot;">​</a></h3><p><strong>现象</strong>：提示 <code>InvalidAccessKeyId</code> 或 <code>SignatureDoesNotMatch</code>。</p><p><strong>解决方案</strong>：</p><ol><li>确认 AK/SK 正确且有效</li><li>检查是否有 AgentKit 服务的访问权限</li><li>确认 AK/SK 没有被禁用或过期</li><li>联系管理员分配相关权限</li></ol><h3 id="问题-资源访问被拒绝" tabindex="-1">问题：资源访问被拒绝 <a class="header-anchor" href="#问题-资源访问被拒绝" aria-label="Permalink to &quot;问题：资源访问被拒绝&quot;">​</a></h3><p><strong>现象</strong>：提示 <code>AccessDenied</code> 或权限不足。</p><p><strong>解决方案</strong>：</p><ol><li>确认账号有相应资源的操作权限</li><li>检查 IAM 角色配置</li><li>联系管理员授予必要权限</li></ol><h2 id="获取帮助" tabindex="-1">获取帮助 <a class="header-anchor" href="#获取帮助" aria-label="Permalink to &quot;获取帮助&quot;">​</a></h2><p>如果以上方案无法解决您的问题，请：</p><ol><li><p><strong>查看日志</strong>：</p><ul><li>本地日志：检查命令行输出</li><li>Platform 日志：访问 AgentKit 控制台查看详细日志</li></ul></li><li><p><strong>联系支持</strong>：</p><ul><li>提供详细的错误信息和日志</li><li>说明复现步骤</li><li>附上相关配置文件（注意脱敏）</li></ul></li><li><p><strong>查阅文档</strong>：</p><ul><li><a href="./../3.agentkit-sdk/1.overview.html">SDK 文档</a></li><li><a href="#">API 文档</a></li><li>火山引擎官方文档</li></ul></li></ol>`,59)])])}const k=a(o,[["render",s]]);export{g as __pageData,k as default};
